import React, { Component } from 'react'

class Signin extends Component {
  render() {
    return (
      <div className="container">
        <h4>Signin</h4>
        <form>
          <div className="form-row">
            <div className="form-group col-md-6">
              <label htmlFor="email">Email</label>
            </div>
          </div>
        </form>
      </div>
    )
  }
}

export default Signin
